import { colors } from '../styles/styles';
import { View } from 'react-native';
import React from 'react';
import Svg, { Circle, G, Path, Rect, Text } from 'react-native-svg';

//https://react-svgr.com/playground/?expandProps=none&native=true

const activeForegroundColor = (isActive) => {
   return isActive ? "white" : "black"
}

const activeBackgroundColor = (isActive) => {
   return isActive ? colors.orange : "#fffa"
}

const IconBackground = (props) => {
   let isActive = props.isActive ?? false;
   let fill = activeBackgroundColor(isActive);

   return (
      <Rect
         ry="16.887417"
         y="0"
         x="0"
         height="100"
         width="100"
         fill={fill}
      />
   )
}

const IconCircle = (props) => {
   let isActive = props.isActive ?? false;
   let foreground = activeForegroundColor(isActive);

   return (
      <Circle
         stroke={foreground}
         strokeWidth="2.42545"
         cx="50"
         cy="50"
         r="44.231518"
      />
   )
}

